$(function(){

    //上海站去验证码
    if(location.host == 'www.fangdi.com.cn'){

        $('body > div.content_box > div.layout.content > div.new_house_search_wrapper.top20.grey_shadow > form > ul > li > div:nth-child(3) > div:nth-child(3)').remove();


        $('.red_btn').removeAttr('onclick');
        $('.red_btn').bind('click', function(){
            $('.layui-form').submit();
        });

        var setPlugin = function(){
        //alert('执行了！');

            if($('.default_row_tr').length){
                $('.default_row_tr').each(function(){
                    var $a = $(this).find('td:eq(1)').find('a');
                    var $td = $(this).find('td:eq(2)');
                    console.log($a.text(),$a.attr('onclick'), $td.text());
                })
            }

        };

    }


    //台州站去价格蒙层
    if(location.host == 'tz.tmsf.com'){
        //console.log('删除蒙层');
        if(document.querySelector("#mask_price")){
            document.querySelector("#mask_price").remove();
        }
        document.querySelectorAll('.ad950').forEach(function(obj){obj.remove()});
    }


    if(location.host == 'zfcj.gz.gov.cn'){

        document.onselectstart = function (e) {
            return true;
        }
        document.oncontextmenu = function (e) {
            return true;
        }


        var arr = document.querySelectorAll("body > div.content > form > table:nth-child(1) > tbody > tr:nth-child(3) > td > table > tbody > tr > td > input");

        document.querySelector("body > div.content > form > table:nth-child(1) > tbody > tr:nth-child(2) > td > strong").append('  共有楼栋数：' + arr.length)

        for(var i = 0; i < arr.length; i++){
            arr[i].parentElement.prepend(arr[i].value);
        }


    /**/
        document.querySelector('iframe').onload = function(){
            //debugger;
            var houseList = document.querySelector('iframe').contentWindow.document.querySelectorAll('a.a_block');
            if(houseList.length > 0){
                document.querySelector('#buildingID:checked').parentElement.append(' 共有房源数：' + houseList.length);

                var a = 0; //不可销售
                var b = 0; //已过户
                var c = 0; //确权不可售
                var d = 0; //预售可售
                var e = 0; //已售
                for(var i =0; i < houseList.length; i++){
                    var bgColor = houseList[i].parentElement.bgColor;
                    var text =  houseList[i].text;
                    if(text.indexOf('■') > 0){
                        e++;
                    }
                    console.log(bgColor);
                    if(bgColor == '#DB4923'){
                        a++;
                    }else if(bgColor == '#008080'){
                        b++;
                    }else if(bgColor == '#940906'){
                        c++;
                    }else if(bgColor == '#638314'){
                        d++;
                    }
                }
                var unSaleCount = a+b+c;

                var msg = '该项目共有楼栋数：[' + arr.length + ']\n所选楼栋有房源：[' + houseList.length + '] 已售房源：['+e+']\n不可销售['+ a + '] 已过户['+ b + '] 确权不可售[' + c + '] 预售可售[' + d + ']';
                console.log(msg);

                // https://www.tampermonkey.net/documentation.php?ext=dhdg#GM_notification
                /**/
                var notify = {
                    text: msg,
                    timeout: 0
                };

                GM_notification(notify);
            }
        }
    }


});
